INSERT INTO `DebateItem` (`debateItemPK`,`debateItemId`,`debateItemParentId`,`debateId`,`debateSummary`,`debateDetail`,`debatePostType`,`authorId`,`itemVersion`,`treeVersion`,`updated`,`status`)
VALUES
	(601,601,NULL,101,'What is the meaning of life?','The meaning of life constitutes a philosophical question concerning the <a href=\"http://en.wikipedia.org/wiki/Purpose\">purpose</a> and significance of life or existence in general. This concept can be expressed through a variety of related questions, such as Why are we here?, What is life all about?, and What is the meaning of it all? It has been the subject of much philosophical, scientific, and theological speculation throughout history. There have been a large number of answers to these questions from many different cultural and ideological backgrounds<br />\nSee reference (1) below.','QUESTION',10144,1,0,'2010-04-22 01:20:46','ACTIVE'),
	(101,601,NULL,101,'What is the meaning of life?','The meaning of life constitutes a philosophical question concerning the <a href=\"http://en.wikipedia.org/wiki/Purpose\">purpose</a> and significance of life or existence in general. This concept can be expressed through a variety of related questions, such as Why are we here?, What is life all about?, and What is the meaning of it all? It has been the subject of much philosophical, scientific, and theological speculation throughout history. There have been a large number of answers to these questions from many different cultural and ideological backgrounds<br />\nSee reference (1) below.','QUESTION',10144,0,0,'2010-04-22 01:20:12','ACTIVE'),
	(602,602,601,101,'There is no meaning','','POSITION',10144,0,1,'2010-04-22 01:21:12','ACTIVE'),
	(603,603,601,101,'42','','POSITION',10144,0,3,'2010-04-22 01:21:30','ACTIVE'),
	(604,604,601,101,'Can I have a hamburger?','You ask me for a hamburger. My attempt to reciprocate is cut brutally short as my body experiences a sudden lack of electrons. Across a variety of hidden dimensions you are dismayed. John Lennon hands me an apple, but it slips through my fingers. I am reborn as an ocelot. You disapprove. A crack echoes through the universe in defiance of conventional physics as cosmological background noise shifts from randomness to a perfect A Flat. Children everywhere stop what they are doing and hum along in perfect pitch with the background radiation. Birds fall from the sky as the sun engulfs the earth. You hesitate momentarily before allowing yourself to assume the locus of all knowledge. Entropy crumbles as you peruse the information contained within the universe. A small library in Phoenix ceases to exist. You stumble under the weight of everythingness, Your mouth opens up to cry out, and collapses around your body before blinking you out of the spatial plane. You exist only within the fourth dimension. The fountainhead of all knowledge rolls along the ground and collides with a small dog. My head tastes sideways as spacetime is reestablished, you blink back into the corporeal world disoriented, only for me to hand you a hamburger as my body collapses under the strain of reconstitution. The universe has reasserted itself. A particular small dog is fed steak for the rest of its natural life. You die in a freak accident moments later, and you soul works at the returns desk for the Phoenix library. You disapprove. Your disapproval sends ripples through the inter-dimensional void between life and death. A small child begins to cry as he walks toward the stairway where his father stands.','POSITION',10144,0,3,'2010-04-22 01:24:52','ACTIVE');
