INSERT INTO `JournalArticle` (`uuid_`,`id_`,`resourcePrimKey`,`groupId`,`companyId`,`userId`,`userName`,`createDate`,`modifiedDate`,`articleId`,`version`,`title`,`urlTitle`,`description`,`content`,`type_`,`structureId`,`templateId`,`displayDate`,`approved`,`approvedByUserId`,`approvedByUserName`,`approvedDate`,`expired`,`expirationDate`,`reviewDate`,`indexable`,`smallImage`,`smallImageId`,`smallImageURL`)
VALUES
	('2322912f-857b-4818-801e-5080389de092',10273,10274,10136,10112,10144,'Test Test','2009-08-30 08:36:53','2010-03-11 16:04:26','10272',1,'Home','home','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><static-content language-id=\"en_US\"><![CDATA[<h2><span class=\"hidden\">What should we humans do about climate change?</span></h2>\n<div class=\"floatLeft holder\">&nbsp;</div>\n<!-- end .holder -->\n<div class=\"floatLeft rightContent\" style=\"clear: right;\">\n<div class=\"home-body-text\"><b>Somehow our species has to answer this question. And you can help.</b><br />\n<br />\nAnyone&mdash;from experts to interested citizens&mdash;can use this site to develop plans for what we humans can do, select the most promising plans, and debate the plans and other issues.</div>\n<div class=\"answerbtn\"><a class=\"help\" href=\"/web/guest/resources/-/wiki/Main/First-time+visitors\"><span class=\"hidden\">Help for first time users</span></a><a class=\"plans\" href=\"/web/guest/plans\"><span class=\"hidden\">View and Vote for Plans</span></a> <a class=\"debates\" href=\"/web/guest/debates\"><span class=\"hidden\">View and Join the Debates</span></a>\n<div class=\"clear\">&nbsp;</div>\n</div>\n<div class=\"news\">\n<h5 class=\"news-heading\">News</h5>\n<ul>\n    <li>The most recent version of the Collaboratorium has been completed and put into production.&nbsp;(<a href=\"http://climatecollaboratorium.org/web/guest/news/-/blogs/33207\">more</a>)</li>\n    <li>Debate barn-raising launched: Is the earth\'s climate changing because of human activity? (<a href=\"http://climatecollaboratorium.org/web/guest/news/-/blogs/31497\">more</a>)</li>\n    <li>&quot;Copenhagen Challenge&quot; final round winners announced (<a href=\"http://www.climatecollaboratorium.org/web/guest/news/-/blogs/30108\">more</a>)</li>\n    <li>Climate Collaboratorium launches new site &nbsp;(<a href=\"/web/guest/news/-/blogs/26051\">more</a>)</li>\n</ul>\n</div>\n</div>\n<!-- end .rightContent -->\n<div class=\"clear\">&nbsp;</div>\n<div class=\"logBox\">\n<div class=\"floatLeft\"><a href=\"http://cci.mit.edu\"><img alt=\"Climate\" src=\"/collaboratorium-theme/images/home_Climate.png\" /></a></div>\n<div class=\"floatLeft text\">\n<p><strong>The Climate Collaboratorium</strong> is a project of the <a href=\"http://cci.mit.edu\">MIT Center for Collective Intelligence</a> (<a href=\"/web/guest/resources/-/wiki/Main/Credits\">credits</a>).</p>\n<p><strong>Financial support</strong> has been provided by the <a href=\"http://cci.mit.edu/about/sponsors.html\">corporate sponsors of the MIT Center for Collective Intelligence,</a> the&nbsp;<a href=\"http://www.argosyfoundation.com/\">Argosy Foundation</a>, the&nbsp;<a href=\"http://web.mit.edu/mitei/\">MIT Energy Initiative</a>, and the <a href=\"http://mitsloan.mit.edu/sustainability/\">MIT Sloan Sustainability Initiative</a>.</p>\n</div>\n</div>]]></static-content></root>','general','','','2009-08-30 08:34:00',1,10144,'Test Test','2009-08-30 08:36:53',0,NULL,NULL,1,0,10275,''),
	('68045665-55c2-428a-888d-26d71e0ca7f8',10415,10416,10136,10112,10144,'Test Test','2009-08-30 11:32:03','2009-08-30 13:45:16','10414',1,'Sample model','sample-model','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><static-content language-id=\"en_US\"><![CDATA[<div id=\"clockwatch_8228583_event_19\"><b>BBC Sport\'s Sarah Holt in Spa:</b> &quot;Zut alors, I\'m late for the live today Caroline. Sorry, I\'ve just driven back from the paddock to BBC HQ - it\'s so far away that I have to be chauffeured to and fro all day by some friendly Belgians. Luca Badoer was up to some hi-jinks in the paddock, jumping into shot on a TV interview, but whether he will still be in the Ferrari at the next GP in Monza remains a hot topic. Italian Giancarlo Fisichella and most recently Toro Rosso\'s Swiss star Sebastien Buemi have been tipped to replace him&hellip; we await with interest. Seems like plenty of fans in Spa were expecting Michael Schumacher to back in the red car judging by the &quot;Welcome back Schumacher&hellip; Woohoo!&quot; sign on the way up to the circuit and the \'Schumacher Comeback\' baseball hats on sale. Oh dear.&quot;<img width=\"226\" vspace=\"0\" hspace=\"0\" height=\"170\" border=\"0\" alt=\"David Coulthard stands at Eau Rouge corner at Spa\" src=\"http://newsimg.bbc.co.uk/media/images/46292000/jpg/_46292047_dc_eaurouge.jpg\" /></div><div id=\"clockwatch_8228583_event_18\"><b>1223:</b> If you\'re watching BBC1, I feel it\'s only right to warn you you\'re about to see Eddie Jordan as you\'ve hopefully never seen him before - in his swimming trunks at Rubens Barrichello\'s house.</div><div id=\"clockwatch_8228583_event_17\"><b>Giancarlo Fisichella, speaking to David Coulthard on BBC1:</b> &quot;When you do pole position with a good car, it\'s great, but when you do it like [Saturday], with not a winning car, with a small team, it\'s just like something very amazing, very unusual.&quot;</div><div id=\"clockwatch_8228583_event_16\"><!-- S IIMA --> <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"right\" style=\"width: 44px; height: 1px;\"> <tbody><tr><td><div>&nbsp;</div></td></tr> </tbody></table> <!-- E IIMA --> <b>From Bee, London, via text on 81111:</b> &quot;Would it be possible/likely that Ferrari box Badoer early in the race on the basis of a \'mechanical failure\'? This would avoid any more embarrassment, costs and danger to the other drivers.&quot;</div><div id=\"clockwatch_8228583_event_15\"><b>1217:</b> The all-important fashion update: shades of grey for Coulthard and Humphrey. Maroon cords (I think) and maroon-striped shirt for Jordan. No real surprises there. Where do you go to buy maroon cords I wonder...</div><div id=\"clockwatch_8228583_event_14\"><!-- S ILIN --> <a href=\"http://twitter.com/sarahholtf1\" class=\"inlineText\"><b>BBC Sport\'s Sarah Holt on Twitter:</b></a> <!-- E ILIN --> &quot;How low can Luca Badoer go? He\'s dropped five grid places for changing a gearbox but as he\'s at the back how far can he go? Someone said Brussels.</div> <!-- S IIMA --> <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" align=\"right\" style=\"width: 71px; height: 21px;\"><tbody><tr><td>&nbsp;</td></tr> </tbody></table> <!-- E IIMA --> <p><b>David Coulthard on the challenge of Eau Rouge:</b></p><p>&quot;It\'s blind faith. You have no idea what\'s coming on the top of the hill. If that\'s not exciting for any driver then I don\'t know what is. The difficult part of the corner is just as it starts to rise up as the car is experiencing both lateral load [G-Forces] and compression and you have no idea what\'s coming up over the peak. But the historic track has been modified now; there is more run off on the left and the barriers has been moved out to the right which means the consequences of going full throttle over the hill are less than they were. It still seems unbelievably fast now I\'m stood watching the cars instead of racing&quot;.</p>]