	(10213,'WOL',3,1221260468243,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n\n<data>\n	<tables-sql><![CDATA[\ncreate table WOL_MeetupsEntry (\n	meetupsEntryId LONG not null primary key,\n	companyId LONG,\n	userId LONG,\n	userName VARCHAR(75) null,\n	createDate DATE null,\n	modifiedDate DATE null,\n	title VARCHAR(75) null,\n	description STRING null,\n	startDate DATE null,\n	endDate DATE null,\n	totalAttendees INTEGER,\n	maxAttendees INTEGER,\n	price DOUBLE,\n	thumbnailId LONG\n);\n\ncreate table WOL_MeetupsRegistration (\n	meetupsRegistrationId LONG not null primary key,\n	companyId LONG,\n	userId LONG,\n	userName VARCHAR(75) null,\n	createDate DATE null,\n	modifiedDate DATE null,\n	meetupsEntryId LONG,\n	status INTEGER,\n	comments STRING null\n);\n\ncreate table WOL_SVNRepository (\n	svnRepositoryId LONG not null primary key,\n	url VARCHAR(200) null,\n	revisionNumber LONG\n);\n\ncreate table WOL_SVNRevision (\n	svnRevisionId LONG not null primary key,\n	svnUserId VARCHAR(75) null,\n	createDate DATE null,\n	svnRepositoryId LONG,\n	revisionNumber LONG,\n	comments STRING null\n);\n\ncreate table WOL_WallEntry (\n	wallEntryId LONG not null primary key,\n	groupId LONG,\n	companyId LONG,\n	userId LONG,\n	userName VARCHAR(75) null,\n	createDate DATE null,\n	modifiedDate DATE null,\n	comments STRING null\n);]]></tables-sql>\n	<sequences-sql><![CDATA[]]></sequences-sql>\n	<indexes-sql><![CDATA[create index IX_79AEBAB6 on WOL_MeetupsEntry (companyId);\n\ncreate index IX_83877F55 on WOL_MeetupsRegistration (meetupsEntryId);\ncreate index IX_C28F993B on WOL_MeetupsRegistration (meetupsEntryId, status);\ncreate index IX_4262CE8F on WOL_MeetupsRegistration (userId, meetupsEntryId);\n\ncreate index IX_75C012F on WOL_SVNRepository (url);\n\ncreate index IX_1AF89E5F on WOL_SVNRevision (svnRepositoryId);\ncreate index IX_8645F460 on WOL_SVNRevision (svnUserId);\ncreate index IX_25E1E8E0 on WOL_SVNRevision (svnUserId, svnRepositoryId);\n\ncreate index IX_CB1E7CE7 on WOL_WallEntry (groupId);\ncreate index IX_E65FFE21 on WOL_WallEntry (groupId, userId);\ncreate index IX_C7F3D45D on WOL_WallEntry (userId);]]></indexes-sql>\n</data>'),
	(20803,'Chat',11,1224096251555,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n\n<data>\n	<tables-sql><![CDATA[\ncreate table Chat_Entry (\n	entryId LONG not null primary key,\n	createDate LONG,\n	fromUserId LONG,\n	toUserId LONG,\n	content STRING null\n);\n\ncreate table Chat_Status (\n	statusId LONG not null primary key,\n	userId LONG,\n	modifiedDate LONG,\n	online_ BOOLEAN,\n	awake BOOLEAN,\n	activePanelId VARCHAR(75) null,\n	message STRING null,\n	playSound BOOLEAN\n);]]></tables-sql>\n	<sequences-sql><![CDATA[]]></sequences-sql>\n	<indexes-sql><![CDATA[create index IX_DAEF230F on Chat_Entry (createDate);\ncreate index IX_AD559D93 on Chat_Entry (createDate, fromUserId);\ncreate index IX_D9E49928 on Chat_Entry (createDate, fromUserId, toUserId);\ncreate index IX_8BE273A4 on Chat_Entry (createDate, toUserId);\ncreate index IX_F9966D55 on Chat_Entry (fromUserId);\ncreate index IX_2A17A23F on Chat_Entry (fromUserId, toUserId, content);\ncreate index IX_16384BE6 on Chat_Entry (toUserId);\n\ncreate index IX_15BD544A on Chat_Status (modifiedDate);\ncreate index IX_B723B792 on Chat_Status (modifiedDate, online_);\ncreate index IX_32531B3D on Chat_Status (online_);\ncreate unique index IX_E17EBD79 on Chat_Status (userId);]]></indexes-sql>\n</data>');
